import './webService.scss';
import { useState } from 'react';

const WebService = (): JSX.Element => {

    return (
        <div className="webService">
            <div className="webService__imageWrapper">
                <img src="https://source.unsplash.com/random/?web,service" alt="item" />
            </div>
            <div className="webService__textWrapper">
                <span>Do you need help with builidng your webshop or webpage?</span>
            </div>
        </div>
    );
}

export default WebService;
